import React from 'react'

const HoursBar = props => {

    const hours = []

    for(let i = 0; i < 24; i++){
        hours.push(<li key={i}>Hi {i}</li>)
    }

    return(
       <ul>
           hours
       </ul>
    )

}

export default HoursBar
